webpackJsonp([0xc521fc969e84],{4193:function(t,a){t.exports={data:{markdownRemark:{html:"<p>みなさんお元気ですか？自分は今回コミケでの戦利品が申込書だけと言うちょっとびみょんな気分です。(東方の日はトリトンタワーの上層階から仕事しながら遠くに見える逆三角の鳥居を横目に心の中で応援していましたです) ところで、そろそろアレも出たと言うことでdanmaq恒例のソレをやろうかと思ったのですが生憎委託組なのでorz そんなわけで、夏コミはお休みしましたけれど冬コミは参加の方向で仕事進めてますよー。今回は時封城や夢終劇のようなデカい作品じゃありません(レイラ程度に思ってくださいな)とりあえず10月くらいには詳細出せるかも。</p>\n<h2>9/2追記</h2>\n<p>C73申込完了しましたですよー。秘封倶楽部の本を出そうかなと考えてたり。夢終劇で「こんなん東方じゃねーよ」って意見が結構あったみたいなので、今回は夢終劇の作者である自分ですら「……これは東方と言えるのか？」と首をかしげたくなるくらいに東方と非東方の境界を突き詰めたシナリオを考えてみました。詳細は上述通り10月の初めくらいになりそうですので気長に待っててくださいな。 しかしオンライン申込みを選択してなかったらホンキで終わってたな自分 orz まぁ慣れの問題なんだろうけど、はじめてのオンライン申込みってすげー緊張って言うか不安感。書類不備ってしまうんんじゃないか？って不安が郵送で申込みするより3倍くらい強くて、すごい緊張してしまう。あとカットも不安。カラーは論外として、グレイスケールはOKなんだろうか？中間色は全部自前でアミにして、2色に落とすべきなんだろうか…とかアミにするとしたらどのくらいの大きさがベストだろうか……(細かすぎるとモアレが出やすい)とか、ものっそい不安だったり 'Ａ｀</p>",frontmatter:{cover:null,date:"2007-09-01T21:59:00+09:00",strDate:"2007/9/1",title:"生存報告"}}},pathContext:{path:"/ja/blog/2007/09/01-生存報告/",langKey:"ja"}}}});
